import React from "react";
import "./Experience.css";

const Experience = () => {
  return (
    <div className="Experience">
      <div class="timeline">
        <div class="container left">
          <div class="content">
            <h2>2017</h2>
            <p>Lorem ipsum..</p>
          </div>
        </div>
        <div class="container right">
          <div class="content">
            <h2>2016</h2>
            <p>Lorem ipsum..</p>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Experience;
